CREATE TABLE neural_network_models (
    model_id UUID PRIMARY KEY,
    model_name VARCHAR(50) NOT NULL,
    performance_metrics JSONB
);

CREATE TABLE training_data (
    data_id UUID PRIMARY KEY,
    model_id UUID REFERENCES neural_network_models(model_id),
    training_loss FLOAT,
    validation_accuracy FLOAT
);

CREATE TABLE hyperparameters (
    hyper_id UUID PRIMARY KEY,
    model_id UUID REFERENCES neural_network_models(model_id),
    learning_rate FLOAT,
    batch_size INTEGER
);

CREATE TABLE neural_network_models (
    model_id UUID PRIMARY KEY,
    model_name TEXT,
    accuracy FLOAT,
    loss FLOAT
);

CREATE TABLE training_data (
    data_id UUID PRIMARY KEY,
    model_id UUID REFERENCES neural_network_models(model_id),
    dataset_name TEXT,
    training_duration INTERVAL
);

CREATE TABLE hyperparameters (
    hyperparam_id UUID PRIMARY KEY,
    model_id UUID REFERENCES neural_network_models(model_id),
    learning_rate FLOAT,
    batch_size INTEGER
);

CREATE TABLE evaluation_metrics (
    eval_id UUID PRIMARY KEY,
    model_id UUID REFERENCES neural_network_models(model_id),
    precision FLOAT,
    recall FLOAT
);

CREATE TABLE performance_metrics (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    training_accuracy FLOAT,
    test_accuracy FLOAT
);

CREATE TABLE model_details (
    model_id INT PRIMARY KEY,
    architecture VARCHAR(255),
    optimizer VARCHAR(255),
    learning_rate FLOAT
);

CREATE TABLE hyperparameters (
    model_id INT PRIMARY KEY,
    batch_size INT,
    epochs INT,
    dropout_rate FLOAT
);
